DROP DATABASE IF EXISTS ImperioDosChocolates;
CREATE DATABASE ImperioDosChocolates;
USE ImperioDosChocolates;

SET FOREIGN_KEY_CHECKS = 0;

CREATE TABLE Funcionario (
    id_funcionario INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
    id_filial VARCHAR(4) NOT NULL,
    nome VARCHAR(100) NOT NULL,
    idade INT NOT NULL,
    cpf VARCHAR(15) NOT NULL,
    rg VARCHAR(15) NOT NULL,
    cnpj VARCHAR(20) NOT NULL,
    email VARCHAR(50) NOT NULL,
    data_entrada DATE NOT NULL,
    VendasFeitas INT not null,
    desempenho VARCHAR(100) NOT NULL,
    cargo VARCHAR(100) NOT NULL,
    salario DECIMAL(10, 2) NOT NULL,
    telefone VARCHAR(20) NOT NULL,
    data_nascimento date not null,
    FOREIGN KEY (id_filial) REFERENCES Filial(id_filial)
);

CREATE TABLE Cliente (
    id_cliente INT AUTO_INCREMENT PRIMARY KEY NOT NULL,
    id_filial VARCHAR(4) NOT NULL,
    nome VARCHAR(100) NOT NULL,
    telefone VARCHAR(20) NOT NULL,
    email VARCHAR(100) NOT NULL,
    cpf VARCHAR(15) NOT NULL,
    rg VARCHAR(15) NOT NULL,
    data_de_nascimento DATE NOT NULL,
    idade INT NOT NULL,
    endereco VARCHAR(200) NOT NULL,
    cep VARCHAR(10) NOT NULL,
    bairro VARCHAR(100) NOT NULL,
    estado VARCHAR(50) NOT NULL,
    municipio VARCHAR(100) NOT NULL,
    pais VARCHAR(50) NOT NULL,
    FOREIGN KEY (id_filial) REFERENCES Filial(id_filial)
);

CREATE TABLE Filial (
    id_filial VARCHAR(4) PRIMARY KEY NOT NULL,
    nome VARCHAR(100) NOT NULL,
    endereco VARCHAR(200) NOT NULL,
    telefone VARCHAR(20) NOT NULL,
    cep VARCHAR(10) NOT NULL,
    cnpj VARCHAR(20) NOT NULL,
    bairro VARCHAR(100) NOT NULL,
    estado VARCHAR(50) NOT NULL,
    municipio VARCHAR(100) NOT NULL,
    quantidade_de_funcionarios INT NOT NULL,
    clientes_por_dia INT NOT NULL,
    email VARCHAR(100) NOT NULL,
    pais VARCHAR(50) NOT NULL
);

-- Peso é em kg!
CREATE TABLE Estoque (
    id_estoque INT AUTO_INCREMENT PRIMARY KEY NOT NULL,
    id_filial VARCHAR(4) NOT NULL,
    nome_do_chocolate VARCHAR(100) NOT NULL,
    quantidade_estoque INT NOT NULL,
    data_de_validade DATE NOT NULL,
    data_que_foi_entregue DATE NOT NULL,
    tipo_do_chocolate VARCHAR(100) NOT NULL,
    peso DECIMAL(10, 2) NOT NULL,
    FOREIGN KEY (id_filial) REFERENCES Filial(id_filial)
);

create table item_venda(
	id_item_venda int primary key not null,
    id_venda int not null,
    id_estoque int not null,
    quantidade_vendida int not null,
    preco_unitario decimal(10, 2) NOT NULL,
    preco_total_da_venda decimal(10,2) NOT NULL,
    foreign key (id_venda) references Vendas(id_venda),
    foreign key (id_estoque) references Estoque(id_estoque)
);

CREATE TABLE Vendas (
    id_venda INT AUTO_INCREMENT PRIMARY KEY NOT NULL,
    id_cliente INT NOT NULL,
    id_funcionario int NOT NULL,
    id_filial VARCHAR(4) NOT NULL,
    data_da_compra DATE NOT NULL, 
    statusDoPedido VARCHAR(50) NOT NULL,
    forma_de_pagamento VARCHAR(50) NOT NULL,
    data_do_envio DATE NOT NULL,
    FOREIGN KEY (id_cliente) REFERENCES Cliente(id_cliente),
    FOREIGN KEY (id_filial) REFERENCES Filial(id_filial),
    FOREIGN KEY (id_funcionario) REFERENCES Funcionario(id_funcionario)
);
















































